script: |
  super -f text -I q1234.spq | sort > q1234.out

inputs:
  - name: q1234.spq
    data: |
      SELECT + + COUNT ( * ) * + COUNT ( CAST ( 65 AS REAL ) ) AS col1 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q1234.out
    data: |
      81
